import "../Css/utils.css"
export const NormalButton = (style={},onClickFunc=() => {},buttTxt="") => {
  return(
    <div 
      style={{borderRadius:10}}
      onClick={() => {onClickFunc()}}>
      <p>{buttTxt}</p>
    </div>
  )
}
export const PurpleButton = (style={},onClickFunc=() => {},buttTxt="") => {
  return(
    <div 
      className="bck-clr-purple-dark"
      style={{borderRadius:10}}
      onClick={() => {onClickFunc()}}>
      <p>{buttTxt}</p>
    </div>
  )
}
